import React from 'react';

function Login(props) {
    const [email, setEmail] = React.useState('');
    const [password, setPassword] = React.useState('');

    function handleEmailChange(e) {
        setEmail(e.target.value);
    }

    function handlePasswordChange(e) {
        setPassword(e.target.value);
    }

    function handleSubmit(e) {
        e.preventDefault();
        props.onLogin(email, password);
    }

    return (
        <section className="auth-container">
            <h3 className="auth-container__title">Вход</h3>
            <form action="#" class="form" name="place-profile">
                <div class="form__text-wrap">
                    <input required="" type="text" name="name" class="form__text form__text_type_title-name" placeholder="Название" id="place-title-input" minlength="2" maxlength="30" value="" />
                        <span class="form__error place-title-input-error"></span></div><div class="form__text-wrap">
                    <input required="" type="url" name="link" class="form__text form__text_type_link" placeholder="Ссылка на картинку" id="link-input" value="" />
                        <span class="form__error link-input-error"></span>
                </div>
                <button type="submit" class="form__button">Войти</button>
            </form>
        </section >
    );
}

export default Login;
